def solution():
    """James's favorite basketball player got paid based on how many points he averaged each week. He gets $10,000 if he averages 30 or more points a game and $8,000 if he averages under 30 points a game. For his last week, in the first game he scored 30 points and in the second game he scored 28 points. In the third game he scored 32 points. In the fourth game he scored 34 points and in the fifth game he scored 26 points. How much does he get paid for the week?"""
    points = [30, 28, 32, 34, 26]
    avg_points = sum(points) / len(points)
    if avg_points >= 30:
        total_pay = 10000
    else:
        total_pay = 8000
    result = total_pay
    return result

def solution():
    """Annie is trying to figure out whether it's safe to drive her truck. For every 3 degrees the temperature drops below 32 degrees, Annie's chances of skidding on ice increase 5%. If she goes into a skid, she has a 40% of regaining control. Otherwise, she'll have a serious accident. If the temperature is 8 degrees, what is the percentage chance of Annie getting into a serious accident if she drives?"""
    temp_drop = 32 - 8
    skid_chance_increase = (temp_drop // 3) * 5
    initial_chance = 0
    for i in range(skid_chance_increase):
        if initial_chance == 0:
            initial_chance = 40
        else:
            initial_chance = initial_chance * 0.6
    serious_accident_chance = 100 - initial_chance
    result = serious_accident_chance
    return result

def solution():
    """Bill is buying healthcare on an exchange. The normal monthly price of the plan he wants is $500. The government will pay for part of this cost depending on Bill's income: 90% if he makes less than $10,000, 50% if he makes between $10,001 and $40,000, and 20% if he makes more than $50,000. Bill earns $25/hour and works 30 hours per week, four weeks per month. How much will Bill spend for health insurance in a year?"""
    monthly_healthcare_cost = 500
    annual_income = 25 * 30 * 4 * 12 # $36,000 per year
    if annual_income < 10000:
        government_contribution = monthly_healthcare_cost * 0.9
    elif annual_income < 40000:
        government_contribution = monthly_healthcare_cost * 0.5
    elif annual_income > 50000:
        government_contribution = monthly_healthcare_cost * 0.2
    else:
        government_contribution = 0
    bill_amount = monthly_healthcare_cost - government_contribution
    total_cost = bill_amount * 12
    result = total_cost
    return result

def solution():
    """Karen's class fund contains only $10 and $20 bills, which amount to $120. The number of $10 bills is twice as many $20 bills. How many $20 bills do they have in their fund?"""
    total_money = 120
    x = 2
    y = 1
    while x * 10 + y * 20 != total_money:
        if x * 10 + y * 20 > total_money:
            y -= 1
            x += 2
        else:
            y += 1
    result = y
    return result
